!function(i) {

        i(window).scroll(function() {
                100 < i(this).scrollTop() ? i("#back-to-top").fadeIn() : i("#back-to-top").fadeOut()
        }),
        i("#back-to-top").on("click",
        function(t) {
                return t.preventDefault(),
                i("html, body").animate({
                        scrollTop: 0
                },
                100),
                !1
        });


} (jQuery)
